import React from 'react';
import prototype from "prop-types";


const foodILike = [
  {
    id:1,    
    name: "kimchi",
    rating: 5,
    image:"data:image/jpeg;base64,"
  },
  {
    id:2,
    name: "삼겹살",
    rating: 4.1,
    image:"data:image/jpeg;base64,"
  },
  {
    id:3,
    name: "비빔밥",
    rating: 4.5,
    image:"data:image/jpeg;base64,"
  },
  {
    id:4,
    name: "돈까스",
    rating: 5,
    image:"data:image/jpeg;base64,"
  }
]

function Food({name, picture, rating}){  
  return  (<div>
    <h2>I like {name}</h2>
    <h4>{rating}/5.0</h4>
    <img src = {picture} art = {name}/>
  </div>);
}

Food.prototype = {
  name: prototype.string.isRequired,
  picture: prototype.string.isRequired,
  rating: prototype.number,

}


function App() {
  return (
    <div className="App">    
      {
        foodILike.map(dish => ( 
          <Food 
          key = {dish.id}
          name = {dish.name}
          rating = {dish.rating}
          picture = {dish.image}          
          /> 
        ))
      }
    </div>
  );
}

export default App;
